import React from 'react';
import CircularProgress from '@material-ui/core/CircularProgress';

export const Loading = () => {
	return(
	<div style={{
		width:'100%',
		margin: '20px auto'
	}}>
		<CircularProgress disableShrink />
	</div>
	);
};
export default Loading;
